// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./EduBoxERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract EduBoxERC20Factory is Ownable {
    IERC20 public eduToken;
    uint256 public constant CREATION_FEE = 1 ether; // 1 Edu Token
    address public feeRecipient;
    
    struct TokenInfo {
        address tokenAddress;
        string name;
        string symbol;
        address owner;
    }
    
    TokenInfo[] public createdTokens;

    event TokenCreated(address indexed tokenAddress, string name, string symbol, address indexed owner);
    event EduTokenUpdated(address indexed newEduTokenAddress);
    event FeeRecipientUpdated(address indexed newFeeRecipient);

    constructor(address _eduTokenAddress, address _feeRecipient) {
        require(_eduTokenAddress != address(0), "Invalid EduToken address");
        require(_feeRecipient != address(0), "Invalid fee recipient address");
        eduToken = IERC20(_eduTokenAddress);
        feeRecipient = _feeRecipient;
    }

    function setEduTokenAddress(address _eduTokenAddress) external onlyOwner {
        require(_eduTokenAddress != address(0), "Invalid EduToken address");
        eduToken = IERC20(_eduTokenAddress);
        emit EduTokenUpdated(_eduTokenAddress);
    }

    function setFeeRecipient(address _feeRecipient) external onlyOwner {
        require(_feeRecipient != address(0), "Invalid fee recipient address");
        feeRecipient = _feeRecipient;
        emit FeeRecipientUpdated(_feeRecipient);
    }

    function createToken(
        string memory name,
        string memory symbol,
        uint8 decimals,
        uint256 initialSupply,
        uint256 cap,
        string memory logoURL,
        string memory website,
        string memory socialMediaLinks,
        address owner
    ) external {
        require(bytes(name).length > 0, "Name cannot be empty");
        require(bytes(symbol).length > 0, "Symbol cannot be empty");
        require(initialSupply > 0, "Initial supply must be greater than 0");
        require(cap >= initialSupply, "Cap must be greater than or equal to initial supply");
        require(owner != address(0), "Invalid owner address");

        require(eduToken.transferFrom(msg.sender, feeRecipient, CREATION_FEE), "Creation fee transfer failed");

        EduBoxERC20 newToken = new EduBoxERC20(
            name,
            symbol,
            decimals,
            initialSupply,
            cap,
            owner,
            logoURL,
            website,
            socialMediaLinks
        );

        createdTokens.push(TokenInfo({
            tokenAddress: address(newToken),
            name: name,
            symbol: symbol,
            owner: owner
        }));

        emit TokenCreated(address(newToken), name, symbol, owner);
    }

    function getTokenCount() public view returns (uint256) {
        return createdTokens.length;
    }

    function getTokenInfo(uint256 index) public view returns (TokenInfo memory) {
        require(index < createdTokens.length, "Token index out of bounds");
        return createdTokens[index];
    }

    function getCreatedTokens(uint256 start, uint256 end) public view returns (TokenInfo[] memory) {
        require(start < end, "Invalid range");
        require(end <= createdTokens.length, "End out of bounds");
        
        TokenInfo[] memory tokens = new TokenInfo[](end - start);
        for (uint256 i = start; i < end; i++) {
            tokens[i - start] = createdTokens[i];
        }
        return tokens;
    }
}

